import React from 'react'
import styled from 'styled-components'

const Container=styled.div`
position: absolute;
height: 120px;
left: 0px;
right: 0px;
top: 0px;

background: rgba(255, 255, 255, 0.96);
`
const Wrapper=styled.div`
position: absolute;
width: 1120px;
height: 50px;
left: calc(50% - 1120px/2);
top: calc(50% - 50px/2);
display:flex;
justify-content: space-between;
`
const Left=styled.div`
position: absolute;
width: 97px;
height: 32px;

top: calc(50% - 32px/2);
`
const Center=styled.div`
position: absolute;
width: 323.06px;
height: 32px;
left: 398.47px;
top: calc(50% - 32px/2);
`
const Right=styled.div`
box-sizing: border-box;

/* Auto layout */

display: flex;
flex-direction: row;
align-items: flex-start;
padding: 9px 17.6719px 11px 18px;

position: absolute;
width: 108.67px;
height: 44px;
right: 0px;
top: calc(50% - 44px/2);

background: #1355FF;
border: 2px solid #1355FF;
`
const Navbar = () => {
  return (
    <Container>
      <Wrapper>
        <Left>left</Left>
        <Center></Center>
        <Right></Right>
      </Wrapper>
    </Container>
  )
}

export default Navbar
